import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <ul>
        <li>
        <h1 className="Logo col-lg-6">NBA Scores</h1>
        </li>
        <li>
          <a href="#">Scores</a>
        </li>
        <li>
          <a href="#">Leaders</a>
        </li>
      </ul>

    </div>
  );
}

export default App;
